import React, { useState } from 'react';
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper, TextField, Button } from '@mui/material';

const TrackingStatus = () => {
  const initialOrder = {
    id: 1,
    Number: '',
    RecipientDateTime: '',
    Status: '',
    DocumentCost: '',
    PhoneRecipient: '',
    RecipientFullName: '',
    DocumentWeight: '',
  };

  const [orders, setOrders] = useState([initialOrder]);
  const [nextId, setNextId] = useState(2);
  const [errors, setErrors] = useState({});

  const handleNumberChange = (id, value) => {
    const updatedOrders = orders.map((order) =>
      order.id === id ? { ...order, Number: value } : order
    );

    const error = value.length !== 14 && value.length > 0 ? 'Введите 14-значный номер' : '';

    setErrors({ ...errors, [id]: error });
    setOrders(updatedOrders);
  };

  const addOrder = () => {
    setOrders([
      ...orders,
      { ...initialOrder, id: nextId },
    ]);
    setNextId(nextId + 1);
  };

  const removeOrder = (id) => {
    setOrders(orders.filter((order) => order.id !== id));
    setErrors(Object.fromEntries(Object.entries(errors).filter(([key]) => key !== String(id))));
  };

  return (
    <TableContainer component={Paper}>
      <Table>
        <TableHead>
          <TableRow>
            <TableCell>Номер ЕН</TableCell>
            <TableCell>Дата отправки</TableCell>
            <TableCell>Статус отправки</TableCell>
            <TableCell>Сумма</TableCell>
            <TableCell>Номер телефона</TableCell>
            <TableCell>Имя</TableCell>
            <TableCell>Себестоимость</TableCell>
            <TableCell>Действия</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {orders.map((order) => (
            <TableRow key={order.id}>
              <TableCell>
                <TextField
                  value={order.Number}
                  onChange={(e) => handleNumberChange(order.id, e.target.value)}
                  placeholder="Введите номер"
                  error={!!errors[order.id]}
                  helperText={errors[order.id]}
                />
              </TableCell>
              <TableCell>
                <TextField
                  value={order.RecipientDateTime}
                  onChange={(e) => setOrders(orders.map(o => o.id === order.id ? { ...o, RecipientDateTime: e.target.value } : o))}
                  placeholder="Введите дату"
                />
              </TableCell>
              <TableCell>
                <TextField
                  value={order.Status}
                  onChange={(e) => setOrders(orders.map(o => o.id === order.id ? { ...o, Status: e.target.value } : o))}
                  placeholder="Введите статус"
                />
              </TableCell>
              <TableCell>
                <TextField
                  value={order.DocumentCost}
                  onChange={(e) => setOrders(orders.map(o => o.id === order.id ? { ...o, DocumentCost: e.target.value } : o))}
                  placeholder="Введите сумму"
                />
              </TableCell>
              <TableCell>
                <TextField
                  value={order.PhoneRecipient}
                  onChange={(e) => setOrders(orders.map(o => o.id === order.id ? { ...o, PhoneRecipient: e.target.value } : o))}
                  placeholder="Введите номер телефона"
                />
              </TableCell>
              <TableCell>
                <TextField
                  value={order.RecipientFullName}
                  onChange={(e) => setOrders(orders.map(o => o.id === order.id ? { ...o, RecipientFullName: e.target.value } : o))}
                  placeholder="Введите имя"
                />
              </TableCell>
              <TableCell>
                <TextField
                  value={order.DocumentWeight}
                  onChange={(e) => setOrders(orders.map(o => o.id === order.id ? { ...o, DocumentWeight: e.target.value } : o))}
                  placeholder="Введите вес"
                />
              </TableCell>
              <TableCell>
                <Button onClick={addOrder} variant="contained" color="primary">
                  Добавить
                </Button>
                <Button onClick={() => removeOrder(order.id)} variant="contained" color="secondary">
                  Удалить
                </Button>
              </TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
};

export default TrackingStatus;
